import React, { useState } from "react";
import { Button, Alert, Modal, ModalHeader, ModalBody, ModalFooter, Form, FormGroup, Label, Input } from "reactstrap";
import { useAuth0, withAuthenticationRequired } from "@auth0/auth0-react";
import { getConfig } from "../config";
import Loading from "../components/Loading";

const ExternalApiComponent = () => {
  const { apiOrigin = "http://localhost:3001", audience } = getConfig();

  const [state, setState] = useState({
    showResult: false,
    apiMessage: "",
    error: null,
  });

  const [modalOpen, setModalOpen] = useState(false);
  const [email, setEmail] = useState("");
  const [score, setScore] = useState("");

  const toggleModal = () => {
    setModalOpen(!modalOpen);
  };

  const handleDonate = async () => {
    try {
      // Perform donation action here
      // Fetch data or perform any necessary API call
      // You can use email and score state values here

      // Close the modal after donation is done
      toggleModal();
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }
  };

  const {
    getAccessTokenSilently,
    loginWithPopup,
    getAccessTokenWithPopup,
  } = useAuth0();

  const handleConsent = async () => {
    try {
      await getAccessTokenWithPopup();
      setState({
        ...state,
        error: null,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }

    await callApi();
  };

  const handleLoginAgain = async () => {
    try {
      await loginWithPopup();
      setState({
        ...state,
        error: null,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }

    await callApi();
  };

  const callApi = async () => {
    try {
      const token = await getAccessTokenSilently();

      const response = await fetch(`${apiOrigin}/api/external`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      const responseData = await response.json();

      setState({
        ...state,
        showResult: true,
        apiMessage: responseData,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }
  };

  const handle = (e, fn) => {
    e.preventDefault();
    fn();
  };

  return (
      <div className="text-center d-flex justify-content-center align-items-center h-100">
        <div>
          <h1>Score: 100</h1>
          <div className="mb-5">
            {state.error === "consent_required" && (
                <Alert color="warning">
                  You need to{" "}
                  <a
                      href="#/"
                      className="alert-link"
                      onClick={(e) => handle(e, handleConsent)}
                  >
                    consent to get access to users api
                  </a>
                </Alert>
            )}

            {state.error === "login_required" && (
                <Alert color="warning">
                  You need to{" "}
                  <a
                      href="#/"
                      className="alert-link"
                      onClick={(e) => handle(e, handleLoginAgain)}
                  >
                    log in again
                  </a>
                </Alert>
            )}

            <Button
                color="primary"
                className="mt-5"
                onClick={toggleModal}
                disabled={!audience}
            >
              Donate Carbon Credit
            </Button>

            {/* Modal for donation */}
            <Modal isOpen={modalOpen} toggle={toggleModal}>
              <ModalHeader toggle={toggleModal}>Donate Carbon Credit</ModalHeader>
              <ModalBody>
                <Form>
                  <FormGroup>
                    <Label for="email">Email</Label>
                    <Input
                        type="email"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="score">Score</Label>
                    <Input
                        type="number"
                        id="score"
                        value={score}
                        onChange={(e) => setScore(e.target.value)}
                    />
                  </FormGroup>
                </Form>
              </ModalBody>
              <ModalFooter>
                <Button color="primary" onClick={handleDonate}>
                  Donate
                </Button>{" "}
                <Button color="secondary" onClick={toggleModal}>
                  Cancel
                </Button>
              </ModalFooter>
            </Modal>
          </div>
        </div>
      </div>
  );
};

export default withAuthenticationRequired(ExternalApiComponent, {
  onRedirecting: () => <Loading />,
});
